App = Em.Application.create({
    rootElement: $(".view-container")
}), App.Router.map(function() {
    this.route("mongo", {
        path: "/mongo"
    });
}), App.IndexRoute = Ember.Route.extend({
    setupController: function(a) {
        a.set("model", [ "a", "b", "c" ]);
    }
}), App.MongoSample = Ember.Object.extend(), App.MongoSample.reopenClass({
    all: function() {
        return $.getJSON("http://invite-voiceflows.appspot.com/api/invite/a59ba960e8f148fab76658b4724b982e").then(function(a) {
            var b = [];
            return a.contacts.forEach(function(a) {
                b.push(App.MongoSample.create(a));
            }), console.log(b), b;
        });
    }
}), App.MongoRoute = Ember.Route.extend({
    model: function() {
        return App.MongoSample.all();
    }
});